name: Configure elasticsearch_exporter

Answer: ansible.builtin.template:
  src: '{{ _elasticsearch_exporter_config_file[ansible_os_family] | default(_elasticsearch_exporter_config_file[''default''])
    }}'
  dest: '{{ _elasticsearch_exporter_config_directory[ansible_os_family] | default(_elasticsearch_exporter_config_directory[''default''])
    }}/{{ _elasticsearch_exporter_config_file[ansible_os_family] | default(_elasticsearch_exporter_config_file[''default''])
    }}'
  mode: '0640'
notify:
- Restart elasticsearch exporter

